import style from "./Carousel.module.css";

const Carousel = () => {
  return (
    <div
      className="gallery js-flickity"
      data-flickity-options='{ "wrapAround": true }'
    >
      <div className={style.galleryCell}></div>
      <div className={style.galleryCell}></div>
      <div className={style.galleryCell}></div>
      <div className={style.galleryCell}></div>
      <div className={style.galleryCell}></div>
    </div>
  );
};

export default Carousel;
